The recommender system is complex, but to maximize reusability, Gorse has abstracted the data used in a recommender system as a collection of three entities: users, items, and feedback. User: A user entity consists of a user ID and labels describing the user. The user labels can be empty, but these labels help to improve the recommendation accuracy of the recommender system. type User struct { UserId string Labels []string
} Item: A item entity consists of an item ID, its visibility, its categories, an item timestamp, and labels describing the item. The timestamp and labels can be empty, and similarly based on labels information helps to improve the recommendation accuracy of the recommender system, while the timestamp is used to estimate the freshness of the item. Read 2.2 Item Management for more information about IsHidden and Categories fields. type Item struct { ItemId string IsHidden bool Categories []string Timestamp time.Time Labels []string Comment string
} Feedback: A feedback entity consists of user ID, item ID, feedback type, and feedback timestamp, where the triad of user ID, item ID, and feedback type is required to be unique in the database. Feedback represents events that happened between users and items, which can be positive or negative. For example, sharing and liking are the user's positive feedback to an item. If the user does not have further positive feedback after reading, the user's feedback on the item is considered negative. If the user views the item, read feedback will be recorded. Then, if the user gives positive feedback to the item, the read feedback will be overwritten by the positive feedback. Conversely, if the user does not give positive feedback, then the read feedback is considered negative feedback. type Feedback struct { FeedbackType string UserId string ItemId string Timestamp time.Time
} Gorse's server node provides RESTful APIs for inserting users, items, and feedback, as well as getting a recommendation for users. Please refer to the RESTful API documentation for a detailed description. METHOD URL DESCRIPTION POST /api/item Insert item. POST /api/user Insert user. POST /api/feedback Insert feedback if the feedback not exist. PUT /api/feedback Insert feedback, and overwrites existed feedback. The user and item must exist when a feedback is inserted. Gorse server nodes will create new users and new items automatically according to the following configurations: # Insert new users while inserting feedback. The default value is true.
auto_insert_user = true # Insert new items while inserting feedback. The default value is true.
auto_insert_item = true Auto created users and items have ID only and other fields are all empty.

