A recommender system is expected to recommend items to users. To learn the preferences of each user, feedbacks between users and items are fed to the recommender system. In Gorse, there are three types of entities. User: A user is identified by a string identifier. type User struct { UserId string
} Item: A item is identified by a string identifier. A timestamp is used to record the freshness of this item. The timestamp could be the last update time, release time, etc. Labels are used to describe characters of this item, eg., tags of a movie. type Item struct { ItemId string Timestamp time.Time Labels []string
} Feedback: A feedback is identified a triple: feedback type, user ID, and item ID. The type of feedback can be positive (like), negative (dislike), or neutral (read). The timestamp record the time that this feedback happened. type Feedback struct { FeedbackType string UserId string ItemId string Timestamp time.Time
} Types of feedbacks are classified into three categories: positive_feedback_types mean a user favors an item. click_feedback_types mean a user favors a recommended item. This item must be recommended by Gorse. read_feedback_type means a user reads an item. However, the real feedback this user has in his/her mind is never known. The difference between positive_feedback_types and click_feedback_types is that the item of click_feedback_types must come from recommendations of Gorse. The item of positive_feedback_types could be found by a user through other approaches such as search, direct access, etc. read_feedback_type is a neutral event. Negative feedback can be conduct by {read_feedback_type items} - {positive_feedback_types items}. There might be an extra field in the defined structure. They are preserved for future usage.
